-- Audit logs indexes
CREATE INDEX IF NOT EXISTS idx_audit_user ON audit_logs(userId);
CREATE INDEX IF NOT EXISTS idx_audit_action ON audit_logs(auditAction);
CREATE INDEX IF NOT EXISTS idx_audit_entity ON audit_logs(entityType, entityId);
CREATE INDEX IF NOT EXISTS idx_audit_created ON audit_logs(createdAt);

-- Media indexes
CREATE INDEX IF NOT EXISTS idx_media_folder ON media(folder);
CREATE INDEX IF NOT EXISTS idx_media_type ON media(fileType);
CREATE INDEX IF NOT EXISTS idx_media_uploaded ON media(uploadedBy);

-- Users indexes
CREATE INDEX IF NOT EXISTS idx_users_role ON users(role);
CREATE INDEX IF NOT EXISTS idx_users_status ON users(userStatus);
CREATE INDEX IF NOT EXISTS idx_users_username ON users(username);

